import { useState, useEffect } from 'react';
import { motion } from 'framer-motion';

export default function App() {
    const [darkMode, setDarkMode] = useState(true);
    const [logoColors, setLogoColors] = useState([
        'from-teal-600', 'via-purple-600', 'to-pink-600'
    ]);

    // Animation du dégradé du logo
    useEffect(() => {
        const gradients = [
            ['from-teal-600', 'via-purple-600', 'to-pink-600'],
            ['from-blue-600', 'via-indigo-600', 'to-violet-600'],
            ['from-emerald-600', 'via-cyan-600', 'to-sky-600'],
            ['from-amber-600', 'via-red-600', 'to-fuchsia-600']
        ];

        const interval = setInterval(() => {
            setLogoColors(gradients[Math.floor(Math.random() * gradients.length)]);
        }, 3000);

        return () => clearInterval(interval);
    }, []);

    const navItems = ['Accueil', 'Projets', 'Processus', 'Expertise', 'Contact'];

    return (
        <div className={`min-h-screen ${darkMode ? 'bg-gray-900 text-gray-100' : 'bg-gray-50 text-gray-900'}`}>
            {/* Header avec ombre portée */}
            <header className={`sticky top-0 z-10 ${darkMode ? 'bg-gray-800/90' : 'bg-white/90'} backdrop-blur-md shadow-md`}>
                <div className="container mx-auto px-6 py-4 flex items-center justify-between">
                    {/* Logo à gauche */}
                    <motion.div className="flex items-center space-x-2">
                        <motion.div
                            key={darkMode ? "dark-logo" : "light-logo"}
                            initial={{ opacity: 0 }}
                            animate={{ opacity: 1 }}
                            transition={{ duration: 0.3 }}
                        >
                            <img
                                src={darkMode ? "public/beyond_logo_light" : "/public/beyond_logo_dark"}
                                alt="Beyond Logo"
                                className="h-10 w-10"
                            />
                        </motion.div>
                        <span className="text-xl font-bold">Beyond</span>
                    </motion.div>

                    {/* Navigation centrée */}
                    <nav className="hidden md:flex items-center space-x-8">
                        {navItems.map((item) => (
                            <motion.a
                                key={item}
                                href="#"
                                whileHover={{ scale: 1.05 }}
                                className={`px-3 py-2 font-medium ${darkMode ? 'text-gray-300 hover:text-white' : 'text-gray-600 hover:text-gray-900'}`}
                            >
                                {item}
                            </motion.a>
                        ))}
                    </nav>

                    {/* Bouton dark mode à droite */}
                    <button
                        onClick={() => setDarkMode(!darkMode)}
                        className={`p-2 rounded-full ${darkMode ? 'bg-gray-700 hover:bg-gray-600' : 'bg-gray-200 hover:bg-gray-300'}`}
                    >
                        {darkMode ? (
                            <svg className="w-5 h-5" fill="currentColor" viewBox="0 0 20 20">
                                <path d="M10 2a1 1 0 011 1v1a1 1 0 11-2 0V3a1 1 0 011-1zm4 8a4 4 0 11-8 0 4 4 0 018 0zm-.464 4.95l.707.707a1 1 0 001.414-1.414l-.707-.707a1 1 0 00-1.414 1.414zm2.12-10.607a1 1 0 010 1.414l-.706.707a1 1 0 11-1.414-1.414l.707-.707a1 1 0 011.414 0zM17 11a1 1 0 100-2h-1a1 1 0 100 2h1zm-7 4a1 1 0 011 1v1a1 1 0 11-2 0v-1a1 1 0 011-1zM5.05 6.464A1 1 0 106.465 5.05l-.708-.707a1 1 0 00-1.414 1.414l.707.707zm1.414 8.486l-.707.707a1 1 0 01-1.414-1.414l.707-.707a1 1 0 011.414 1.414zM4 11a1 1 0 100-2H3a1 1 0 000 2h1z" />
                            </svg>
                        ) : (
                            <svg className="w-5 h-5" fill="currentColor" viewBox="0 0 20 20">
                                <path d="M17.293 13.293A8 8 0 016.707 2.707a8.001 8.001 0 1010.586 10.586z" />
                            </svg>
                        )}
                    </button>
                </div>
            </header>

            {/* Contenu principal */}
            <main className="container mx-auto px-6 py-20">
                <section className="max-w-4xl mx-auto text-center">
                    <motion.div
                        initial={{ opacity: 0, y: 20 }}
                        animate={{ opacity: 1, y: 0 }}
                        transition={{ duration: 0.8 }}
                    >
                        <h1 className="text-4xl md:text-6xl font-bold mb-6 bg-clip-text text-transparent bg-gradient-to-r from-teal-400 to-purple-500">
                            Votre partenaire en design digital
                        </h1>
                        <p className="text-xl md:text-2xl mb-10 max-w-2xl mx-auto">
                            Nous créons des expériences web sur mesure qui transforment vos idées en réalité.
                        </p>

                        <div className="flex flex-col sm:flex-row justify-center gap-4">
                            <motion.button
                                whileHover={{ scale: 1.03 }}
                                whileTap={{ scale: 0.98 }}
                                className="px-8 py-3 bg-gradient-to-r from-teal-500 to-blue-600 text-white rounded-lg font-medium shadow-lg"
                            >
                                Démarrer un projet
                            </motion.button>
                            <motion.button
                                whileHover={{ scale: 1.03 }}
                                whileTap={{ scale: 0.98 }}
                                className="px-8 py-3 border-2 border-gray-300 dark:border-gray-600 rounded-lg font-medium"
                            >
                                Voir nos réalisations
                            </motion.button>
                        </div>
                    </motion.div>
                </section>
            </main>

            {/* Note en bas de page */}
            <footer className="fixed bottom-4 left-4">
                <div className={`flex items-center p-3 rounded-lg shadow-md ${darkMode ? 'bg-gray-800' : 'bg-white'}`}>
                    <input type="checkbox" className="rounded mr-2" />
                    <span className="text-sm">Althos 2.0 - Free Farmer LIX Portfolio Template</span>
                </div>
            </footer>
        </div>
    );
}
